Tribal Passive: <enchanted>{Resists All Ailments}

<ancestralprimary>{True Stealth}
After 3 seconds of not attacking, the Tuatara is hidden from all monsters

<ancestralprimary>{Clone}
Summons a clone of itself

Specialty: <ancestralprimary>{Chills and Freezes}

Tribal Passive: <enchanted>{Evasive and Accurate}

<ancestralprimary>{Ring of Ice}
Creates chilled ground around an ally totem

<ancestralprimary>{Spiritual Chill}
While destroying an enemy totem, freezes that enemy

<ancestralprimary>{Ice Blink}
Teleports away from enemies, dealing cold damage

Specialty: <ancestralprimary>{Buffs with Onslaught}

Tribal Passive: <enchanted>{Ignores some Enemy Block Chance
Unaffected By Taunt}

<ancestralprimary>{Inspiring Blow}
Blows a long note on the horn, giving Onslaught to all nearby allies for 20 seconds

Specialty: <ancestralprimary>{Pulls Teammates and Enemies}

Tribal Passive: <enchanted>{Steals Flask Charges}

<ancestralprimary>{Hook Toss}
Throws out a fishing hook at a Teammate or enemy, pulling them towards the Riptide

