Specialty: <ancestralprimary>{Deals Damage and Petrifies with Jade}

Tribal Passive: <enchanted>{Ignores some Enemy Block Chance
Unaffected By Taunt}

<ancestralprimary>{Encase in Jade}
Creates an expanding jade field that erupts with magic after some time, encasing all enemies with it in jade. While encased in jade, they can't move until hit three times

<ancestralprimary>{Jade Field}
Creates a field of jade stones infused with magic. When an enemy comes close the jade stones erupt, causing other jade stones to erupt too.

Specialty: <ancestralprimary>{Creates Walls to Block Enemies}

Tribal Passive: <enchanted>{Cannot be Slowed Below Base
Overwhelms Physical Damage Reduction}

<ancestralprimary>{Rapid Construction}
Creates a series of wooden walls that blocks the movement of enemies

