Warps Enemies Backwards}

Tribal Passive: <enchanted>{Critical Resistant}

<ancestralprimary>{Storm's Passage}
Creates a sigil under a nearby enemy, and a second sigil towards the enemy side. After 4 seconds warps all enemies in the first sigil to the second sigil

<ancestralprimary>{Conduit of Power}
Channels lightning forward for 5 seconds, then releases a powerful blast of lightning

