<ancestralprimary>{Jade Spirit}
When the Jade Shaman dies, a Spirit of Jade is summoned and continues fighting for 10 seconds

<ancestralprimary>{Buried in Jade}
When the Jade Shaman kills an enemy, their corpse is encased in jade, pausing their revive for 10 seconds. The corpse cannot be revived by Teammates while encased in jade.

<ancestralprimary>{Jade Slice}
